  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  JWILLIAMS, Harold Edward and WALLIS, Elsie Nora Underwood
  JWILLIAMS, Peter Wallis and SMOCK, Victoria
  03> WILLIAMS, Peter Wallis m on 19.12.1988 to (2) SMOCK, Victoria
  b 22.03.1934
  b 05.01.1946
  Peter m. at Te Karaka, Gisborne. Vicki, d/o Coleman and Vivian Smock, USA.
  Address: 442 Highfield Road, Louisville, Kentucky 40207, USA.
  He is now living the USA, where he paints mainly horses and racing scenes.
  05> WILLIAMS, Colin Sydney
  b 28.08.1894 d **.03.1918
  Colin killed in action in France in WW1.
  04> WILLIAMS, Mary Anne m on 08.10.1883 to DAVIES, Christopher Pearson
  b 11.01.1850 d 14.08.1924
  b 11.11.1849 d ** ** 1924
  Mary b. at Waimate and d. at Gisborne. Christopher, slo Christopher Pearson Davies and Marianne Williams, b. at
  Tauranga and d. at Gisborne. The biographies and descendants of Mary and Christopher are listed under
  Christopher's entry in this Family Tree.
  05> WILLIAMS, Allen Marsh m on 10.09.1875 to (1)BUCHANAN, Annabelle Milne (Bella)
  b 27.01.1852 d 11.11.1945
  b 07.09.1842 d 10.04.1888
  Allen b. at Waimate and d. at Te Aute.
  He farmed first at Pakaraka then, moving to Hawkes Bay, he managed "Kereru" for JN Williams
  until 1875 when he married Bella and became manager of the "Te Aute" estate.
  Bella came to Te Aute as governess to the children of Samuel and Mary Williams.
  01> WILLIAMS, Nellie
  b 23.05.1876 d 25.10.1900
  Nellie b. and d. at Te Aute.
  02> WILLIAMS, Mabel Buchanan
  b 05.02.1880 d 02.01.1892
  Mabel b. and d. at Te Aute.
  03> WILLIAMS, Edward Gordon m on 19.05.1909 to EMPSON, Judith Mary
  b 15.02.1881 d 19.03.1962
  b 11.01.1888 d 28.08.1964
  Gordon b. at Te Aute. Judith, d/o Walter Empson and Agnes Acland. Gordon was educated at Wanganui
  Collegiate School. He farmed "Drumpeel" station, Otane and retired to Mount Maunganui. He was a diarist and
  followed an interest in conchology in retirement and had excellent drawing skills. A book titled "Molluscs
  from the Bay of Plenty" containing some of his fine drawings and biological notes was edited by Nicola
  Grimmond and published posthumously in 1964. He served as a Captain in the Cavalry Corps in WW1 and was
  awarded the MC. Judith was choir mistress at Te Aute College and a supporter of the arts.
